More typical variation includes the size and proportional length of the cheliped, ranging from 2.7 to 6.3 × pcl, with that of males more robust than in females. Interestingly, the cheliped fingers may be gaping in one male and not in a similarly-sized male from the same sample. For example, NIWA 21164 includes a male (
7.1 mm
) with palm 4.0 times as long as wide and without gaping fingers, and a male (
7.5 mm
) with distinctly gaping fingers and palm 2.0 times as long as wide. Such differences are in part allometric but may also be related to male-male mate competition (
Claverie & Smith 2007
, 
2010
).
